import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import ServicesBanner from '../components/Banner/ServicesBanner';


const ServiceDatabase = () => {
    return(
        <div className="body_wrapper">

                <OnepageMenu 
                    menu_txt1= "menu_txt1" 
                    menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" 
                    menu_txt6= "menu_txt6" menu_logo= "menu_logo" />              
                <ServicesBanner 
                    ClassC='service_3' 
                    Title='Database'
                    TitleN='Services' 
                    TitleP='We provide the strategic and tactical resources you need to complement your team.'
                    Simage='slider-database.png'/>

        </div>
    )
}
export default ServiceDatabase;
